import collectimgone from './productcollectionimg/Rectangle 18.png';
import collectimgtwo from './productcollectionimg/Rectangle 19.png';
import collectimgthree from './productcollectionimg/Rectangle 20.png';
import collectimgfour from './productcollectionimg/Rectangle 21.png';
import collectimgfive from './productcollectionimg/Rectangle 22.png';
import collectimgsix from './productcollectionimg/Rectangle 23.png';


const Collectiondata = [
    {
        collectionimg: collectimgone ,
        collectiontitle: 'Streetwear Collections'
    },
    {
        collectionimg: collectimgtwo ,
        collectiontitle: 'Striped T-Shirts'
    },
    {
        collectionimg:  collectimgthree,
        collectiontitle: 'Round Neck T-Shirts'
    },
    {
        collectionimg: collectimgfour,
        collectiontitle: 'Printed T-Shirts'
    },
    {
        collectionimg: collectimgfive,
        collectiontitle: 'Oversized T-Shirts'
    },
    {
        collectionimg: collectimgsix,
        collectiontitle: 'Half Sleeves T-Shirts'
    }

];

export default Collectiondata;
